import './Cardcomponent.css';
import { Container, Row, Col, Button } from 'reactstrap';

import sumath from '../sumath.jpg'
import Img from 'react-image';
import Summary from '../Summay/Summary';
import Cot from '../Cot/Cot'
import Yeti from '../Yeti/Yeti';
import Deem from '../Deem/Deem';
import Cigna from '../Cigna/Cigna';
import Usaa from '../Usaa/Usaa';
import Dte from '../Dte/Dte';
import Garden from '../Garden/Garden';
import Gordon from '../Gordon/Gordon';
import William from '../William/William';

//import { Card } from 'reactstrap';
class Cardcomponent extends Component {
  state={
    username:[
      {
        name:"Sravankumar Reddy Tangella"
      }
    ]
  }

    render () {

    return (
        <Container className="containerborder">
        <Row>
        <Col xs="3" className="rightborder">
       <div>

       <Img src={sumath} alt="Avatar" />
       <div className="username">

       <p className="ptag">Sravankumar Reddy Tangella</p>
        <p className="ptag">UX/UI Designer</p>
        <p className="ptag">kumar.tan@outlook.com</p>
        <p className="ptag">510-458-1632</p>
       </div>

       <div className="education">
       <h4 className="h4tag">Education Detials</h4>
       <h6>Master's in computer Science</h6>
       </div>

        </div>
        </Col>
        <Col xs="9">
        <Button className = "btn btn-success btn-circle btn-circle-sm m-1">Download</Button>
        <Summary />
        <Cot />
        <Yeti />
        <Cigna />
        <Usaa />
        <Dte />
        <Garden />
        <William />
        <Gordon />
        <Deem />
        </Col>

      </Row>
      </Container>
    )
    }

  }


export default Cardcomponent;
